import characters from '../db/Character/Character';

function List(props) {
  return <div>
      <p><img src={ props.img } alt='cha_image'/></p>
      <h4>{ props.id }  { props.name }</h4> 
      <p>{ props.nickname }</p>
    </div>
  ;
}

function Character() {

  return (
    <>
      <h1>List of Characters</h1>
      <ul>
        <characters />
        {characters.map((i) => 
        <List 
        key={i.char_id} 
        id={i.char_id}
        name={i.name}
        birthday={i.birthday}
        occupation={i.occupation}
        img={i.img}
        status={i.status}
        appearance={i.appearance}
        nickname={i.nickname}
        portrayed={i.portrayed}
        better_call_saul_appearance={i.better_call_saul_appearance}

         />)}
      </ul>
    </>
  );
}
export default Character;
